import './Socials.css'

export default function Socials(props) {
    return (
        <div className="social-menu">
            <a href="https://www.linkedin.com/in/justin-feldman-294b45161/" target="_blank" rel="noreferrer">
                <img src="https://www.svgrepo.com/show/70809/linkedin.svg" alt="IN" className="icon-social" />
            </a>
            <a href="https://github.com/cdn-bsct" target="_blank" rel="noreferrer">
                <img src="https://www.svgrepo.com/show/343674/github.svg" alt="GH" className="icon-social" />
            </a>
        </div>
    )
}
